                <style jsx>
                    {`
                        h1{
                            color: green;
                        }
                        div{
                            background: grey
                        }
                    `}

                </style>
                <Link href="/Contact">
                    <a>Contact</a>
                </Link>
                <br/>
                <Link href="/blog">
                    <a>Blog</a>
                </Link>
            </div>
        )
    }
}

export default Home
